import React from "react";
import { Timeline } from "react-twitter-widgets";

function Social() {
  return (
    <div>
    <p>aaa</p>
      <main>
        <Timeline
          dataSource={{
            sourceType: "profile",
            screenName: "Polymath | 理系留学サポート",
          }}
          options={{
            height: "800",
          }}
        />
      </main>
    </div>
  );
}

export default Social;
